import React from "react";
import './index.css';
import { useFormik } from "formik";

function App() {
  const formik = useFormik({
    initialValues: {
      email: '',
      password: '',
    },
    onSubmit: values => {
      console.log('form: ', values);
    }
  });

  return (
    <div>
      <form>
        <div>Email:</div>
        <input id="email" type="text"/>
        <div>Password:</div>
        <input id="password" type="text"/>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
